import React from 'react'
import '../Pages/style.css';

export default function header() {
    return (
        <div class="header">
            <h2>E-Visit</h2>
            <div class="right">
                <ul>
                    <li><a href="#">SignUp</a></li>
                    <li><a href="#">Already have an Account?</a></li>
                    <li><a href="#">Login</a></li>
                </ul>
            </div>
        </div> 
    )
}
